/********************************************************************
* FUNCTION u_ietf_interfaces_init
* 
* initialize the ietf-interfaces server instrumentation library
* 
* INPUTS:
*    modname == requested module name
*    revision == requested version (NULL for any)
* 
* RETURNS:
*     error status
********************************************************************/
status_t u_ietf_interfaces_init (
    const xmlChar *modname,
    const xmlChar *revision)
{
    status_t res = NO_ERR;
    ncx_module_t *ietf_interfaces_mod = NULL;

#ifdef u_ietf_interfaces_F_arbitrary_names
    ncx_set_feature_enable(
        y_ietf_interfaces_M_ietf_interfaces,
        (const xmlChar *)"arbitrary-names",
        TRUE);
#else
    ncx_set_feature_enable(
        y_ietf_interfaces_M_ietf_interfaces,
        (const xmlChar *)"arbitrary-names",
        FALSE);
#endif

#ifdef u_ietf_interfaces_F_pre_provisioning
    ncx_set_feature_enable(
        y_ietf_interfaces_M_ietf_interfaces,
        (const xmlChar *)"pre-provisioning",
        TRUE);
#else
    ncx_set_feature_enable(
        y_ietf_interfaces_M_ietf_interfaces,
        (const xmlChar *)"pre-provisioning",
        FALSE);
#endif

#ifdef u_ietf_interfaces_F_if_mib
    ncx_set_feature_enable(
        y_ietf_interfaces_M_ietf_interfaces,
        (const xmlChar *)"if-mib",
        TRUE);
#else
    ncx_set_feature_enable(
        y_ietf_interfaces_M_ietf_interfaces,
        (const xmlChar *)"if-mib",
        FALSE);
#endif

    ietf_interfaces_mod = ncx_find_module(
        y_ietf_interfaces_M_ietf_interfaces,
        y_ietf_interfaces_R_ietf_interfaces);
    if (ietf_interfaces_mod == NULL) {
        return ERR_NCX_OPERATION_FAILED;
    }
    /* put your module initialization code here */
    
    return res;
} /* u_ietf_interfaces_init */

